import './Layout.css'
import NavBar from "../NavBar/NavBar";


const Layout = ({children}) => {
    return (
        <div className='Layout'>
            <header>enkithemystik.com</header>
            <NavBar color='black'/>
            <main className='MainContent'>
                {children}
            </main>
            <footer>
                Copyright {new Date().getFullYear()}
            </footer>
        </div>
    );
}

export default Layout;
